class Solution {
public:
    typedef long long ll;


    long long maximumValueSum(vector<vector<int>>& b) {
        ll n = b.size(),m = b[0].size();
        vector<pair<ll,ll> >v[505];
        for(int i = 0;i < n;i++){
            for(int j = 0;j < m;j++){
                v[i].push_back({(ll)b[i][j],(ll)j});
            }
            sort(v[i].begin(),v[i].end());
        }
        ll ans = -3e9;
        for(int i = 0;i < n;i++){
            for(int j = 0;j < n;j++){
                if (j == i) continue;
                for(int k = 0;k < n;k++){
                    if(k == i||k == j) continue;
                    ll maxx = -3e9;
                    for(int ii = m-1;ii >= m-3;ii--){
                        for(int jj = m-1;jj >= m-3;jj--){
                            for(int kk = m-1;kk >= m-3;kk--){
                                int j1 = v[i][ii].second;
                                int j2 = v[j][jj].second;
                                int j3 = v[k][kk].second;
                                if(j1 != j2 && j3 != j2 && j3 != j1){
                                    maxx = max(maxx,v[i][ii].first+v[j][jj].first+v[k][kk].first);
                                }
                            }
                        }
                    }
                    ans = max(ans,maxx);
                }
            }
        }
        return ans;
    }
};
